import styles from './main.module.css';

export const  Main = () => {
    return(
        <div className={styles.container}>
            <div className={styles.text}>
                <p>당신이 먹는 음식엔</p>
                <p>환경을 오염시키는 탄소가 있습니다.</p>
            </div>
            <div className={styles.main}>
                <img src="./images/1354860_20201112142649_570_0001.jpg"></img>
            </div>
        </div>
    );
}
